-- Department Dimension Table
CREATE TABLE dim_department (
    department_id INT PRIMARY KEY,
    department_name VARCHAR(100)
    -- Add any other relevant attributes here
);

-- Education Dimension Table
CREATE TABLE dim_education (
    education_id INT PRIMARY KEY,
    education_level VARCHAR(50)
    -- Add any other relevant attributes here
);

create table dim_employee (
	employee_id INT PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	birt_date DATE,
	hire_date DATE,
	gender VARCHAR(6),
	department_id INT,
	education_id INT,
	FOREIGN KEY (department_id) REFERENCES dim_department(department_id),
    FOREIGN KEY (education_id) REFERENCES dim_education(education_id)
);


-- Fact Table: EmployeePerformance
CREATE TABLE fact_employee_performance (
    performance_id INT PRIMARY KEY,
    employee_id INT,
    performance_score FLOAT,
    performance_date DATE,
    -- Add any other relevant attributes here
    FOREIGN KEY (employee_id) REFERENCES dim_employee(employee_id)
);

